import Home from "./components/Home"; // Path to your Home component

function App() {
    return (
        <Router>
            <Navbar />
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/skills" element={<Skills />} />
                {/* Add more routes as needed */}
            </Routes>
        </Router>
    );
}

export default App;
